# Alternative Methods To Estimate Body Fat
### Aidan, Ash, Enes, Rajan
### DATA2902 T09ol_ontime_1
### 2020-11-12

---




class: inverse, center, middle

# Part 1: Introduction

---

# Abstract

.pull-left[
- Fat percentage of the human body may be of clinical importance
  - Influence in morbidity and mortality
  - Alter effectiveness of drugs
  - Affect body's ability to retain heat
- Current methods to estimate body fat percentage are expensive and technical
  - Electrical calipers
  - Bioelectrical impedance
  - Hydrostatic weighing
]
.pull-right[
.center[
![Easily obtainable common body measurements](healthline_img.PNG)]
]

--

.blockquote[<i class="fas  fa-crosshairs "></i> **AIM:** To estimate body fat percentage within a ~3% margin of error using multiple linear regression on common body measurements]

---

# The Data Set

## Background
- Collected by the Human Performance Research Center at Brigham Young University
- Originally used to produce predictive equations for body composition (1974)
- Available at https://dasl.datadescription.com/datafile/bodyfat

--

## Variables
.pull-left[
Response
- `pct_bf`

General characteristics
- `age` (years)
- `weight` (kg)
- `height` (cm)
]

.pull-right[
Circumference measurements (cm)
- `neck`, `chest`
- `abdomen`, `hip`
- `thigh`, `knee`
- `ankle`, `bicep`
- `forearm`, `wrist`
]

---

class: inverse, center, middle

# Part 2: Analysis

---

# Analysis: Initial Assumptions


.pull-left[
## <i class="fas  fa-check-square "></i> Linearity
- Response of `pct_bf` against all predictor variables is linear
- `\(\therefore\)` Linearity assumption is satisfied after EDA

]

.pull-right[
![](slides_files/figure-html/unnamed-chunk-1-1.png)&lt;!-- --&gt;
]

--

## <i class="fas  fa-check-square "></i> Independence
- All observations independent measurements taken from 250 different males 
- `\(\therefore\)` Independence assumption is satisfied

---

# Analysis: Model Exploration

## Step-wise search
- Search using AIC and then drop insignificant (*p &lt; 0.05*) predictors

--

- +1cm in abdomen circumference results in +0.98% in body fat on average, holding all else constant
- +1kg in weight results in -0.29% in body fat on average, holding all else constant

# Part 4: Conclusion

---

# Conclusion

## Link to abstract
- Cross-validation score shows that we were on average ~3.6% off the true body fat percentage
- Very similar accuracy to the calipers method
- Easier to measure abdomen circumference and weight

--

## Assumptions and limitations
- Our model met the linearity and `\(\varepsilon \sim N(0, \sigma^2)\)` assumptions
- The source of the data (1974 study) suggested that independence was satisfied 

--

## Future research
- Try other regression methods, e.g. kNN and LASSO
- Implement a train/validation/test workflow to select among these methods (may require more data)

  slideshow.on('beforeShowSlide', function(slide) {
    if (deleted) return;
    var sheets = document.styleSheets, node;
    for (var i = 0; i < sheets.length; i++) {
      node = sheets[i].ownerNode;
      if (node.dataset["target"] !== "print-only") continue;
      node.parentNode.removeChild(node);
    }
    deleted = true;
  });
})();
(function() {
  "use strict"
  // Replace <script> tags in slides area to make them executable
  var scripts = document.querySelectorAll(
    '.remark-slides-area .remark-slide-container script'
  );
  if (!scripts.length) return;
  for (var i = 0; i < scripts.length; i++) {
    var s = document.createElement('script');
    var code = document.createTextNode(scripts[i].textContent);
    s.appendChild(code);
    var scriptAttrs = scripts[i].attributes;
    for (var j = 0; j < scriptAttrs.length; j++) {
      s.setAttribute(scriptAttrs[j].name, scriptAttrs[j].value);
    }
    scripts[i].parentElement.replaceChild(s, scripts[i]);
  }
})();
(function() {
  var links = document.getElementsByTagName('a');
  for (var i = 0; i < links.length; i++) {
    if (/^(https?:)?\/\//.test(links[i].getAttribute('href'))) {
      links[i].target = '_blank';
    }
  }
})();
// adds .remark-code-has-line-highlighted class to <pre> parent elements
// of code chunks containing highlighted lines with class .remark-code-line-highlighted
(function(d) {
  const hlines = d.querySelectorAll('.remark-code-line-highlighted');
  const preParents = [];
  const findPreParent = function(line, p = 0) {
    if (p > 1) return null; // traverse up no further than grandparent
    const el = line.parentElement;
    return el.tagName === "PRE" ? el : findPreParent(el, ++p);
  };

  for (let line of hlines) {
    let pre = findPreParent(line);
    if (pre && !preParents.includes(pre)) preParents.push(pre);
  }
  preParents.forEach(p => p.classList.add("remark-code-has-line-highlighted"));
})(document);</script>

<script>
slideshow._releaseMath = function(el) {
  var i, text, code, codes = el.getElementsByTagName('code');
  for (i = 0; i < codes.length;) {
    code = codes[i];
    if (code.parentNode.tagName !== 'PRE' && code.childElementCount === 0) {
      text = code.textContent;
      if (/^\\\((.|\s)+\\\)$/.test(text) || /^\\\[(.|\s)+\\\]$/.test(text) ||
          /^\$\$(.|\s)+\$\$$/.test(text) ||
          /^\\begin\{([^}]+)\}(.|\s)+\\end\{[^}]+\}$/.test(text)) {
        code.outerHTML = code.innerHTML;  // remove <code></code>
        continue;
      }
    }
    i++;
  }
};
slideshow._releaseMath(document);
</script>
